#InCaseYouMissedIt I had a great conversation with my girl @kymwhitley as I was filling in for @sherrieshepherd and we discussed the importance of mental health with our KIDS.  We also had @DrAlfiee from the @aakomaproject and Danae Aicher from @mochamoms join in on the conversation.  Gems were shared, laughs were plentiful and I left the conversation feeling better prepared to help my child improve his mental well-being.   Head over to the  YouTube.com/TwoFunnyMamas to watch the full episode. 
 
Thanks to all of our partners for bringing this conversation to life! @AdCouncil  @Sounditouttogether
